    fumen:string
    showComments?:boolean,
}

export const Fumen:FC<Props> = (props: Props) => {
    const fumen = props.fumen//props.fumen;
    let pages:Pages;
    try{
        pages = decoder.decode(fumen);
    }catch{
        return <></>
    }

    console.log(pages);

